import React, { useState } from "react";
import "./reserva.css"; // Importe o arquivo CSS para aplicar estilos

function Reserva() {
  // Estados para armazenar a data, hora e quadra selecionadas
  const [data, setData] = useState("");
  const [hora, setHora] = useState("");
  const [quadra, setQuadra] = useState("");

  // Função para lidar com o envio do formulário de reserva
  const handleSubmit = (e) => {
    e.preventDefault();
    // Aqui você pode lidar com o envio do formulário, como enviar os dados para o servidor
    console.log("Data:", data);
    console.log("Hora:", hora);
    console.log("Quadra:", quadra);
  };

  return (
    <div className="reserva-container">
      <h1>Reserva</h1>
      <form className="reserva-form" onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="data">Data:</label>
          <input
            type="date"
            id="data"
            value={data}
            onChange={(e) => setData(e.target.value)}
          />
        </div>
        <div className="form-group">
          <label htmlFor="hora">Hora:</label>
          <input
            type="time"
            id="hora"
            value={hora}
            onChange={(e) => setHora(e.target.value)}
          />
        </div>
        <div className="form-group">
          <label htmlFor="quadra">Quadra:</label>
          <select
            id="quadra"
            value={quadra}
            onChange={(e) => setQuadra(e.target.value)}
          >
            <option value="">Selecione uma quadra</option>
            <option value="quadra1">Quadra 1</option>
            <option value="quadra2">Quadra 2</option>
            <option value="quadra3">Quadra 3</option>
            {/* Adicione mais opções de quadras conforme necessário */}
          </select>
        </div>
        <button type="submit">Reservar</button>
      </form>
    </div>
  );
}

export default Reserva;
